import "./Header.css";
import { NavLink } from "react-router-dom";
import HeaderCartButton from "./HeaderCartButton";

const Header = (props) => {
  return (
    // <nav id="main-menu">
    //   <ul>
    //     <li>
    //       <NavLink to="/home">Home</NavLink>
    //     </li>
    //     <li>
    //       <NavLink to="/about">About</NavLink>
    //     </li>
    //     <li>
    //       <NavLink to="/shop">Shop</NavLink>
    //     </li>
    //     <li>
    //       <NavLink to="/help">Help</NavLink>
    //     </li>
    //     <li>
    //     <NavLink to="/cart"><HeaderCartButton/></NavLink>
    //     </li>
    //   </ul>
    // </nav>
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
      <div class="container-fluid">
        <NavLink class="navbar-brand" href="#">
          E-Shop
        </NavLink>
        <button
          class="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNav">
          <ul class="navbar-nav">
            <li class="nav-item">
              <NavLink class="nav-link active" aria-current="page" to="/home">
                Home
              </NavLink>
            </li>
            <li class="nav-item">
              <NavLink class="nav-link" to="/about">
                About
              </NavLink>
            </li>
            <li class="nav-item">
              <NavLink class="nav-link" to="/shop">Shop
              </NavLink>
            </li>
            <li class="nav-item"><NavLink class="nav-link" to="/help">Help</NavLink></li>
            <li><NavLink to="/cart"><HeaderCartButton /></NavLink></li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Header;
